import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 55.1-1989 Penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-1989.md","filePath":"vacode/55.1-1989.md"}'),r={name:"vacode/55.1-1989.md"},n=t('<h1 id="§-55-1-1989-penalties" tabindex="-1">§ 55.1-1989 Penalties. <a class="header-anchor" href="#§-55-1-1989-penalties" aria-label="Permalink to &quot;§ 55.1-1989 Penalties.&quot;">​</a></h1><p>Any person who willfully violates any provision of § <a href="/vacode/55.1-1972/">55.1-1972</a>, <a href="/vacode/55.1-1974/">55.1-1974</a>, <a href="/vacode/55.1-1975/">55.1-1975</a>, <a href="/vacode/55.1-1976/">55.1-1976</a>, <a href="/vacode/55.1-1979/">55.1-1979</a>, <a href="/vacode/55.1-1982/">55.1-1982</a>, or <a href="/vacode/55.1-1983/">55.1-1983</a> or any regulation adopted under or order issued pursuant to § <a href="/vacode/55.1-1971/">55.1-1971</a>, or any person who willfully in an application for registration makes any untrue statement of a material fact or omits to state a material fact is guilty of a misdemeanor and may be fined not less than $1,000 or double the amount of gain from the transaction, whichever is the larger, but not more than $50,000, or he may be imprisoned for not more than six months, or both, for each offense.</p><p>1974, c. 416, § 55-79.103; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),i=[n];function s(c,l,d,f,h,_){return a(),o("div",null,i)}const u=e(r,[["render",s]]);export{m as __pageData,u as default};
